var User = require('./userModel');

var tools=require('./tools')




function findByEmail(email, cb) {
    User.findOne({'email': email}, cb);
}
module.exports.findByEmail = findByEmail;


function findAll(cb) {
    User.find({}, cb);
}
module.exports.findAll = findAll;


function updateStatus(activeToken, cb) {
    User.findOne({activeToken: activeToken, activeExpires: {$gt: Date.now()}}, function (err, user) {
        if (err) return next(err);

        // 激活码无效
        if (!user) {
           cb(err,{msg: "code invalid"})
        }else{
            console.log(user);
            user.active = true ;
            user.save(cb);
        }
    });
}



module.exports.updateStatus = updateStatus;

function updateDailyReport(email,dailyReport, cb) {
    User.findOne({'email':email},function (err,user) {
        if(err){
            cb(err,null);
        }else{
            user.dailyReport = dailyReport;
            user.save(cb);
        }
    })

}
module.exports.updateDailyReport = updateDailyReport;


function updateFriends(email,friends, cb) {
    User.findOne({'email':email},function (err,user) {
        if(err){
            cb(err,null);
        }else{
            user.friends = friends;
            user.save(cb);
        }
    })

}
module.exports.updateFriends = updateFriends;



function addAFriend(email,friendEmail, cb) {
    User.findOne({'email':email},function (err,user) {
        if(err){
            cb(err,null);
        }else{
            user.friends.push(friendEmail);
            user.save(cb);
        }
    })

}
module.exports.addAFriend = addAFriend;

function updateUser(email, newUser, cb) {
    User.findOne({'email': email}, function (err, user) {
        if (err) {
            cb(err, null)
        } else {
            User.findOne({'email': newUser.email}, function (err, quasiUser) {
                if (err) {
                    cb(err, null)
                } else {
                    if (quasiUser && quasiUser.email != email) {
                        cb(err, {msg: "Email already exists!"})
                    } else {
                        user.firstName = newUser.firstName;
                        user.lastName = newUser.lastName;
                        user.email = newUser.email;
                        user.active = newUser.active;
                        user.accessToken =newUser.accessToken;
                        user.refreshToken =newUser.refreshToken;
                        user.deviceID=newUser.deviceID;
                        user.provider=newUser.provider;
                        user.save(cb)
                    }
                }
            })

        }
    })
}
module.exports.updateUser = updateUser;


function updateAvatar(email,avatar, cb) {
    User.findOne({'email':email},function (err,user) {
        if(err){
            cb(err,null);
        }else{
            user.avatar = avatar;
            user.save(cb);
        }
    })

}
module.exports.updateAvatar = updateAvatar;





