function createUser(email, newUser, cb) {
    console.log(email);



    User.findOne({'email': email}, function (err, user) {
        if (err) {
            cb(err, null)
        } else {
            if (user) {
                cb(err, {msg: "Email already exists!"})
            } else {
                console.log(tools.guid());
                var activeToken= tools.guid();
                var activeExpires= Date.now() + 24 * 3600 * 1000;


                new User({
                    firstName: newUser.firstName,
                    lastName: newUser.lastName,
                    email: newUser.email,
                    role: newUser.role,
                    active: newUser.active,
                    password: newUser.password,
                    activeToken:activeToken,
                    activeExpires: activeExpires,
                    friends:[],
                    dailyReport:{
                        steps: 0,
                        calories:0,
                        sleep:0,
                    },
                    provider:"None",
                    avatar:{
                        filename: "exapmle.jpg",
                        filetype:"image/jpeg",
                        value:""
                    }
                }).save(cb);
            }

        }
    })
}
module.exports.createUser = createUser;




